var MoonPhaseComp = function ()
{
	var p = {
		x:0,	y:0,
		width:350,	height:350,
		canvas:"",	context:"",
		target:"",
		border:false,
		moonImg: new Image(),
	}
	var stage, exportRoot, _thisObj;
	//================================================================================
	// PUBLIC FUNCTIONS
	//================================================================================
	this.init = function (_obj)
	{
		for(var i in _obj)
		{
			p[i] = _obj[i];
		}
		p.x = globalResizeCalc(p.x);
		p.y = globalResizeCalc(p.y);
		p.width = globalResizeCalc(p.width);
		p.height = globalResizeCalc(p.height);
		createCanvas();

		_thisObj = this;
		
		var loader = new createjs.LoadQueue(true);
		loader.addEventListener("fileload", handleFileLoad);
		loader.addEventListener("complete", handleComplete);
		loader.loadManifest(lib.properties.manifest);		
	}
	//================================================================================
	this.getSnapShot = function()
	{
		return {
			x: p.x,
			y: p.y,
			width: p.width,
			height: p.height
		};
	}
	//================================================================================
	this.showPhase = function(viewAngle)
    {
		if(exportRoot)
		{
			var _temPer = Maths.numberToPercent(viewAngle, Math.PI * 2);
			var _frame = Math.round(Maths.percentToNumber(_temPer, 360));
			exportRoot.mitr_moon.gotoAndStop(_frame + 1);
			stage.update();
		}
	}
	//================================================================================
	this.update = function(_obj)
	{
		for(var i in _obj)
		{
			p[i] = _obj[i];
		}
	}
	//================================================================================
	this.setCss = function(_cssObj)
	{
		$(p.canvas).css(_cssObj);
	}
	//================================================================================
	this.addEventListener = function(_evt, _fun)
	{
		p[_evt] = _fun;
	}
	//================================================================================
	this.getCanvas = function()
	{
		return {canvas:p.canvas,context:p.context};
	}
	//================================================================================
	// PRIVATE FUNCTIONS
	//================================================================================
	function createCanvas()
	{
		p.canvas = document.createElement("canvas");
		p.context = p.canvas.getContext("2d");
		if(p.target)
		{
			p.target.append(p.canvas);
		}
		else
		{
			$("body").append(p.canvas);
		}
		p.target = $(p.canvas);
		p.visible == false ? p.target.css("display", "none") : null;
		p.index ? p.target.css("z-index", p.index) : null;
		p.title ? p.target.attr("p_title", p.title) : null;
		//---------
		
		p.canvas.width = 450;
		p.canvas.height = 450;
		
		p.target.css(
		{
			"position":"absolute",
			"left": p.x+"px",
			"top": p.y+"px",
			"width" : p.width,
			"height" : p.height,
			background:"black"
		});
		if(p.border)
			p.target.css("border","solid 1px red");
	}
	//================================================================================
	function handleFileLoad(evt) 
	{
		if (evt.item.type == "image") { images[evt.item.id] = evt.result; }
		//console.log("Moon loaded...........")
		//_thisObj.showPhase(Math.PI);
	}
	//================================================================================
	function handleComplete() {
		exportRoot = new lib.moon1();
		stage = new createjs.Stage(p.canvas);
		stage.addChild(exportRoot);
		stage.update();
		p.onLoad ? p.onLoad() : null;
	}
}